import Layout from '../common/Layout';
import axios from 'axios';
import { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
	faChair,
	faBed,
	faDesktop,
	faWifi,
	faFan,
} from '@fortawesome/free-solid-svg-icons';

// key
// AIzaSyDv6JIUkmdFO-F6Ha1KriiO4uw0Iot8bb4

// palylist
// PLmAX7QJDEdu3phGnuvhY1SIPB47cipfvn

function Youtube() {
	const path = process.env.PUBLIC_URL;
	const desc =
		'Lorem ipsum dolor sit, amet consectetur adipisicing elit. Nulla iure nostrum quisquam minima dolores animi?';

	return (
		<>
			<Layout
				name='Youtube'
				desc={desc}
				visual={`${path}/img/sub/youtube/visual.jpg`}></Layout>

			<div id='youtube'>
				<ul>
					<li>
						<button>
							<caption className='hidden'>의자</caption>
							<FontAwesomeIcon icon={faChair}></FontAwesomeIcon>
						</button>
					</li>
					<li>
						<button>
							<caption className='hidden'>침대</caption>
							<FontAwesomeIcon icon={faBed}></FontAwesomeIcon>
						</button>
					</li>
					<li>
						<button>
							<caption className='hidden'>컴퓨터</caption>
							<FontAwesomeIcon icon={faDesktop}></FontAwesomeIcon>
						</button>
					</li>
					<li>
						<button>
							<caption className='hidden'>와이파이</caption>
							<FontAwesomeIcon icon={faWifi}></FontAwesomeIcon>
						</button>
					</li>
					<li>
						<button>
							<caption className='hidden'>선풍기</caption>
							<FontAwesomeIcon icon={faFan} />
						</button>
					</li>
				</ul>
			</div>
		</>
	);
}

export default Youtube;
